window.bookSummaryJSON = "<p>Hugo Award-winning author Charles Stross continues to make a name for himself in the sci-fi genre. <i>The Jennifer Morgue</i> is an extension of Stross’ award-winning novella <i>The Concrete Jungle</i>. </p> <p>Bob Howard is a special operative for the British agency called The Laundry, and his task is to stop a rogue billionaire from using an artifact, known as Gravedust, with the power to reanimate the dead. The U.S. Black Agency sends the lethal Ramona Random to aid Bob’s mission, but she seems to have a different agenda.</p>"; 
